import logo from './logo.svg';
import './App.css';
import TimeDisplay from './components/TimeDisplay';

function App() {
	return (
		<div className='App'>
			<header className='App-header'>
				<a
					className='App-link'
					href='https://reactjs.org'
					target='_blank'
					rel='noopener noreferrer'
				>
					click here for help lol
				</a>
			</header>
			<TimeDisplay />
			<TimeInput />
		</div>
	);
}

export default App;
